import React, { Component } from 'react'
import Dog from '../images/dog.png';
import AOS from 'aos';
import 'aos/dist/aos.css';


export class Header extends Component {
  componentDidMount(){
    AOS.init({
      duration : 2000
    })
  }
  render() {
    return (
      <div className="App-header Relative">

      <div className="Relative HeadingHolder1">
       <h1 className="Heading1" data-aos='slide-up'>ROTWEILLER</h1>
     </div>

     <div className="Relative HeadingHolder2">
       <h1 className="Heading2" data-aos='slide-up'>CARE 101</h1>
     </div>

     <div className="Relative SideText" data-aos='slide-left' >
       <h1>MAN'S BEST FRIEND <span>_________________________________</span></h1>
   </div>

     <div className="DogImgHolder Relative">
       <img src={Dog} className="Dog" alt="logo" data-aos='slide-right' />
     </div>

     <div className="Absolute Scroll " >
       <h1 className="ScrollHeading" >
       <svg xmlns="http://www.w3.org/2000/svg" x="0px" y="0px"
width="24" height="24"
viewBox="0 0 172 172"
style=" fill:#000000;"><g fill="none" fill-rule="nonzero" stroke="none" stroke-width="1" stroke-linecap="butt" stroke-linejoin="miter" stroke-miterlimit="10" stroke-dasharray="" stroke-dashoffset="0" font-family="none" font-weight="none" font-size="none" text-anchor="none" style="mix-blend-mode: normal"><path d="M0,172v-172h172v172z" fill="none"></path><g fill="#ffffff"><path d="M100.33333,136.16667v-121.83333c0,-7.91917 -6.41417,-14.33333 -14.33333,-14.33333v0c-7.91917,0 -14.33333,6.41417 -14.33333,14.33333v121.83333z" opacity="0.35"></path><path d="M55.22633,129c-4.4075,0 -6.622,5.31767 -3.51883,8.44233l29.20417,29.412c2.80217,2.83083 7.38167,2.83083 10.18383,0l29.20417,-29.412c3.096,-3.12467 0.87433,-8.44233 -3.526,-8.44233z"></path></g></g></svg>
       </h1>
   </div>

   </div>

    )
  }
}

export default Header
